import logo from './pluginIcon.png';
import './App.css';

    /*
      fetch(raw)
      .then(r => r.text())
      .then(text => {
       const txtContent = text;
      });
      */


function App() {

  var inputContent;

  fetch('input.txt')
  .then(r => r.text())
  .then(text => console.log(text))
  .then(text => {
    inputContent = text;
  });


   return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>adventofcode.com/2023</code> 
        </p>
        <a
          className="App-link"
          href="https://adventofcode.com/2023/day/1"
          target="_blank"
          rel="noopener noreferrer"
        >
          Day 1: Trebuchet?!
        </a>
      </header>
      <body className="App-body">
        List of strings {inputContent}
      </body>
    </div>
  );
}

export default App;
